import React from "react";

function FilterYear(props) {
  return (
    <div
      style={{
        display: "flex",
        width: "93%",
        height: 50,
        fontSize: 20,
        margin: 20,
        justifyContent: "space-between",
        alignItems: "center",
      }}
    >
      <b
        style={{
          color: "white",
        }}
      >
        Filter by year
      </b>
      <select
        style={{
          color: "black",
          width: 190,
          borderRadius: 5,
          right: 0,
          height: 50,
          fontSize: 20,
          fontWeight: "bold",
          textAlign: "center",
        }}
        onChange={props.onClick}
      >
        {props.detailDate.map((value, i) => {

            const year = value.date.slice(0, 4)
            if( year !== value.date.slice(0, 4) ) {
                return
            }
            return (
                <option key={i} 
                >
                    {year}
                </option>
            )
        })}
      </select>
    </div>
  );
}

export default FilterYear;
